jaffle_shop:
  outputs:
    dev:
      dataset: <name of a `dataset` on your BiGQuery warehouse>
      job_execution_timeout_seconds: 300
      job_retries: 1
      location: US
      method: service-account
      priority: interactive
      project: <name of the GCP project containing your BiGQuery warehouse>
      threads: 1
      type: bigquery
      keyfile: ./<name of your google api BigQuery credential file>.json
  target: dev
